import Button from './Button';
import Select from 'react-dropdown-select'

const Home = ({ title, showCheckOut, buttonToggle, currencyRate, changeCurrencyRate }) => {
    return (
        <div className='header'>
            <h1>{title}</h1>
            <h2>
                <Select options={currencyRate} onChange={changeCurrencyRate} />
                <Button color={showCheckOut ? 'red' : 'green'} text={showCheckOut ? 'Order' : 'Go To Basket'} onClick={buttonToggle} />
            </h2>
        </div>
    )
}

Home.defaultProps = {
    title: 'Merchandises'
}

export default Home
